import React from 'react';
import './App.css';
import ProfilePage from "./Components/Profile/ProfilePage";
import DialogPage from "./Components/Dialogs/DialogPage";
import {BrowserRouter, Route} from "react-router-dom";
import LoginPage from "./Components/Login/LoginPage";
import NewsPage from "./Components/News/NewsPage";
import MusicPage from "./Components/Music/MusicPage";
import SettingsPage from "./Components/Settings/SettingsPage";

const App = (props) => {
        return (
            <BrowserRouter>

                <div className="App">

                    <Route exact  path='/' render={() => <ProfilePage posts={props.state.posts}
                                                                      profile={props.state.profile}
                                                                      dispatch={props.dispatch}
                                                                      currentPostMessValue={props.state.currentPostMessValue}  /> }/>
                    <Route path='/dialogs' render={() => <DialogPage dialogMessages={props.state.dialogMessages}
                                                                     currentDialogMessValue={props.state.currentDialogMessValue}
                                                                     dispatch={props.dispatch} />}/>
                    <Route path='/login' component={LoginPage}/>
                    <Route path='/news' component={NewsPage}/>
                    <Route path='/music' component={MusicPage}/>
                    <Route path='/settings' component={SettingsPage}/>

                </div>
            </BrowserRouter>
        );
    }


export default App;
